import { Route, Switch } from 'react-router';
import Home from './components/Home';
import Booking from './components/Booking';
import Login from './components/Login';
import Register from './components/Register';
import Payment from './components/Payment';
import ErrorWorld from './components/ErrorWorld';
import Admin from './components/Admin';
import AddFlight from './components/AddFlight';
import FlightListAdmin from './components/FlightListAdmin';
import Passengers from './components/Passengers';
import Ticket from './components/Ticket' 
import Tickets from './components/Tickets';
import UpdateFlight from './components/UpdateFlight';
import Summary from './components/Summary';
import CustomerLogin from './components/customer/CustomerLogin';
import CustomerRegister from './components/customer/CustomerRegister';
import OwnerLogin from './components/owner/OwnerLogin';
import OwnerRegister from './components/owner/OwnerRegister';
import FoodItem from './components/customer/FoodItem';
import Food from './components/customer/Food';
import Cart from './components/customer/Cart';
import EditFoodItem from './components/owner/EditFoodItem';
import AddFoodItem from './components/owner/AddFoodItem';

function App() {
  return (
    <main>
      <Switch>
        <Route path="/" component={Home} exact />
        <Route path="/booking" component={Booking} />
        <Route path="/passengers" component={Passengers} />
        <Route path="/ticket" component={Ticket} />
        <Route path="/tickets" component={Tickets} />
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/payment" component={Payment} />
        <Route path="/summary" component={Summary} />
        <Route path="/admin" component={Admin} />
        <Route path="/addFlight" component={AddFlight} />
        <Route path="/allFlights" component={FlightListAdmin} />
        <Route path="/updateFlight" component={UpdateFlight} />

        <Route path="/CustomerLogin" component={CustomerLogin} />
        <Route path="/CustomerRegister" component={CustomerRegister} />
        <Route path="/OwnerRegister" component={OwnerRegister} />
        <Route path="/OwnerLogin" component={OwnerLogin} />
        <Route path="/FoodItem" component={FoodItem} />
        <Route path="/Food" component={Food} />
        <Route path="/Cart" component={Cart} />
        <Route path="/EditFoodItem" component={EditFoodItem} />
        
        <Route component={ErrorWorld} />
        
      </Switch>
    </main>
  );
}

export default App;
